import logo from "./logo.svg";
import "./App.css";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Admin from "./components/Admin";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Home />
      </div>
      <Routes>
        <switch>
          <Route path="/admin">
            <Admin />
          </Route>
        </switch>
      </Routes>
    </Router>
  );
}

export default App;
